import React from 'react';
import { Link } from 'react-router-dom';
import './Dashboard.css';

export const Home: React.FC = () => {
  return (
    <div className="dashboard">
      <header>
        <h1>Welcome to NASA Exoplanet Lab</h1>
        <p>Explore exoplanets, run advanced analysis, and visualize transits.</p>
      </header>

      <div className="input-section">
        <h2>Get Started</h2>
        <p>
          Use the Advanced Analysis to predict habitability and classify planets.
        </p>
        <Link to="/dashboard">
          <button>Advanced Analysis</button>
        </Link>
      </div>

      <div className="nav-links" style={{ marginTop: 20 }}>
        <Link to="/about" style={{ marginRight: 12 }}>About Us</Link>
        <Link to="/contact">Contact Us</Link>
      </div>
    </div>
  );
};
